import React from 'react';
import {Header} from './mycomponent/Header';
import {Body} from './mycomponent/Body';

let font = {
    fontSize: '20px',
}

const App = () => {
    return (
        <div style={font}>
            <Header/>
            <Body />
        </div>
    )
}

export default App;
